import React from 'react';
import { motion } from 'framer-motion';

export default function ProjectPage() {
  const AnalysisBlock = ({ title, description, pythonCode, analysisText, visualizationContent }) => (
    <section className="mb-10 bg-white p-8 rounded-lg shadow-md border border-gray-200">
      <h2 className="text-3xl font-bold text-gray-800 mb-4 border-b-2 pb-2 border-blue-300">
        {title}
      </h2>
      <p className="text-gray-600 leading-relaxed mb-6">{description}</p>

      {pythonCode && (
        <div className="mb-6">
          <h3 className="text-xl font-semibold text-gray-800 mb-3">Código Python</h3>
          <pre className="bg-gray-800 text-white p-4 rounded-md overflow-x-auto text-sm">
            <code>{pythonCode}</code>
          </pre>
        </div>
      )}

      {analysisText && (
        <div className="mb-6">
          <h3 className="text-xl font-semibold text-gray-800 mb-3">Análisis Textual</h3>
          <p className="text-gray-700 leading-relaxed">{analysisText}</p>
        </div>
      )}

      <div>
        <h3 className="text-xl font-semibold text-gray-800 mb-3">Visualización / Resultados</h3>
        <div className="bg-gray-100 p-6 rounded-lg border border-gray-300 min-h-[200px] flex items-center justify-center text-gray-500 italic">
          {visualizationContent || <p>Pega aquí tus imágenes o resultados de Colab.</p>}
        </div>
      </div>
    </section>
  );

  // Lista de secciones de ejemplo
  const sections = [
    {
      title: "Introducción",
      description: "Este proyecto analiza datos de grupos de investigación reconocidos en Colombia...",
      pythonCode: null,
      analysisText: "El objetivo es aplicar técnicas de análisis de datos y visualización...",
      visualizationContent: null
    },
    {
      title: "1. Carga e inspección inicial",
      description: "Se carga el CSV en Pandas y se visualiza su estructura con df.info() y df.describe()...",
      pythonCode: `import pandas as pd
df = pd.read_csv('Grupos_de_Investigacion.csv')
df.info()
df.describe()`,
      analysisText: "Aquí identificamos número de registros, tipos de datos y posibles valores nulos...",
      visualizationContent: null
    }
  ];

  // URL de tu notebook en Colab
  const colabLink = "https://colab.research.google.com/drive/1WL4mikMw0siJe-ziyCRtxkdTW9kUIZbw";
  // Convertirlo para usar nbviewer
  const nbviewerURL = `https://nbviewer.org/url/${encodeURIComponent(
    colabLink.replace("https://colab.research.google.com/drive/", "https://colab.research.googleusercontent.com/drive/")
  )}`;

  return (
    <motion.div
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.8 }}
      className="min-h-screen bg-gradient-to-br from-green-50 to-blue-50 p-8"
    >
      <div className="max-w-5xl mx-auto">
        <h1 className="text-4xl font-extrabold text-gray-900 mb-6 text-center">
          PROYECTO FINAL - ANÁLISIS DE GRUPOS DE INVESTIGACIÓN
        </h1>
        <p className="text-lg text-gray-700 mb-10 text-center">
          Este proyecto documenta y presenta el ciclo inicial de un análisis de datos orientado a Machine Learning,
          usando como caso de estudio un dataset de grupos de investigación reconocidos en Colombia.
        </p>

        {sections.map((sec, idx) => (
          <AnalysisBlock key={idx} {...sec} />
        ))}

        {/* Visualizador del Notebook de Colab */}
        <section className="mb-10 bg-white p-8 rounded-lg shadow-md border border-gray-200">
          <h2 className="text-3xl font-bold text-gray-800 mb-4 border-b-2 pb-2 border-blue-300">
            Notebook de Google Colab
          </h2>
          <p className="text-gray-600 mb-4">
            Aquí puedes visualizar el notebook completo directamente dentro de esta página.
          </p>
          <iframe
            src={nbviewerURL}
            width="100%"
            height="800"
            style={{ border: "none" }}
            title="Notebook de Colab"
          />
        </section>

        <section className="mb-10">
          <h2 className="text-3xl font-bold text-gray-800 mb-4 border-b-2 pb-2 border-blue-300">
            Entrega
          </h2>
          <ul className="list-disc list-inside text-gray-600 leading-relaxed">
            <li>Formato PDF con código, análisis y visualizaciones.</li>
            <li>Fecha límite: [Definir]</li>
            <li>Envío por correo al docente.</li>
          </ul>
        </section>
      </div>
    </motion.div>
  );
}
